NewJInternalFrame.jTextPane7.text=Rohit admitted to the Level 1 offence 2.2 of the IPLs code of conduct and accepted the sanction.  Mumbai Indians skipper Rohit Sharma has been fined 15 percent of his match fee for hitting the stumps with his bat after his dismissal during their IPL match against Kolkata Knight Riders in Kolkata.Expressing his frustration after being given out leg before wicket, the batsman hit the stumps with his bat at the non-strikers end, violating the Indian Premier League\u2019s code of conduct at the Eden Gardens Sunday night.Mumbai Indians lost the high-scoring match by 34-runs, helping the hosts snap a six-match losing streak.Rohit admitted to the Level 1 offence 2.2 of the IPL\u2019s code of conduct and accepted the sanction.\u201cMr. Sharma admitted to the Level 1 offence 2.2 of the IPL\u2019s Code of Conduct and accepted the sanction,\u201d an IPL release said.With MI chasing an imposing target of 233 to win and ensure a play-offs berth, Rohit looked in good touch before misreading a Harry Gurney delivery which hit his back leg.While the umpire had no hesitation in ruling the batsman out, Rohit opted for DRS, which upheld the field official\u2019s decision.Rohit was earlier fined \u20b912 lakh for his team\u2019s slow over-rate against Kings XI Punjab.\n           
